Ext.data.JsonP['API_Builder_FAQ']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>API Builder FAQ</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p></div>\n        <div class=\"header\"/>\n\n        <div id=\"src-50168708\" class=\"content\">\n                        <h1>API Builder FAQ</h1>\n    <p>This document provides references to answer several API Builder frequently asked questions (FAQs).    </p>\n    <p>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Builder_FAQ-section-src-50168708_APIBuilderFAQ-Submitabug\">Submit a bug</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Builder_FAQ-section-src-50168708_APIBuilderFAQ-SetupAppceleratorCLI\">Setup Appcelerator CLI</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Builder_FAQ-section-src-50168708_APIBuilderFAQ-CreateanAPIBuilderproject\">Create an API Builder project</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Builder_FAQ-section-src-50168708_APIBuilderFAQ-RunanAPIBuilderproject\">Run an API Builder project</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Builder_FAQ-section-src-50168708_APIBuilderFAQ-DeployanAPIBuilderproject\">Deploy an API Builder project</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Builder_FAQ-section-src-50168708_APIBuilderFAQ-Publishsourcecode\">Publish source code</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Builder_FAQ-section-src-50168708_APIBuilderFAQ-PublishsourcecodebyprovidingaDockerfile\">Publish source code by providing a Dockerfile</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Builder_FAQ-section-src-50168708_APIBuilderFAQ-PublishsourcecodeusinganexistingDockerfile\">Publish source code using an existing Dockerfile</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Builder_FAQ-section-src-50168708_APIBuilderFAQ-ConfigureaccesstotheAPIBuilderAdminconsole\">Configure access to the API Builder Admin console</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Builder_FAQ-section-src-50168708_APIBuilderFAQ-CreateamodelusingtheAPIBuilderAdminconsole\">Create a model using the API Builder Admin console</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Builder_FAQ-section-src-50168708_APIBuilderFAQ-AccessAPIBuilderSwaggerdefinitions\">Access API Builder Swagger definitions</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Builder_FAQ-section-src-50168708_APIBuilderFAQ-CreateAPIendpoints\">Create API endpoints</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Builder_FAQ-section-src-50168708_APIBuilderFAQ-ConfigureAPIBuilder\">Configure API Builder</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Builder_FAQ-section-src-50168708_APIBuilderFAQ-CreateAPIBuilderconnectors\">Create API Builder connectors</a>    </p>\n</li></ul>    <div class=\"section section-2 \" id=\"src-50168708_APIBuilderFAQ-Submitabug\">\n        <h2 class=\"heading \"><span>Submit a bug</span></h2>\n    <p>Refer to <a class=\"document-link \" href=\"#!/guide/Reporting_Bugs_or_Requesting_Features\">Reporting Bugs or Requesting Features</a> for more information.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50168708_APIBuilderFAQ-SetupAppceleratorCLI\">\n        <h2 class=\"heading \"><span>Setup Appcelerator CLI</span></h2>\n    <p>Refer to the Setup section of <a class=\"document-link \" href=\"#!/guide/API_Builder_Getting_Started_Guide\">API Builder Getting Started Guide</a> for more information.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50168708_APIBuilderFAQ-CreateanAPIBuilderproject\">\n        <h2 class=\"heading \"><span>Create an API Builder project</span></h2>\n    <p>Refer to the <i class=\" \">Create a project</i> section of <a class=\"document-link \" href=\"#!/guide/API_Builder_Getting_Started_Guide\">API Builder Getting Started Guide</a> for more information.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50168708_APIBuilderFAQ-RunanAPIBuilderproject\">\n        <h2 class=\"heading \"><span>Run an API Builder project</span></h2>\n    <p>Refer to the <i class=\" \">Run the project</i> section of <a class=\"document-link \" href=\"#!/guide/API_Builder_Getting_Started_Guide\">API Builder Getting Started Guide</a> for more information.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50168708_APIBuilderFAQ-DeployanAPIBuilderproject\">\n        <h2 class=\"heading \"><span>Deploy an API Builder project</span></h2>\n    <p>Refer to the <i class=\" \">Deploy the project</i> section of <a class=\"document-link \" href=\"#!/guide/API_Builder_Getting_Started_Guide\">API Builder Getting Started Guide</a> for more information.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50168708_APIBuilderFAQ-Publishsourcecode\">\n        <h2 class=\"heading \"><span>Publish source code</span></h2>\n    <p>Refer to the <i class=\" \">Publish source code</i> section of <a class=\"document-link \" href=\"#!/guide/API_Builder_CLI\">API Builder CLI</a> for information on publishing source code using the legacy method.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50168708_APIBuilderFAQ-PublishsourcecodebyprovidingaDockerfile\">\n        <h2 class=\"heading \"><span>Publish source code by providing a Dockerfile</span></h2>\n    <p>Refer to the <i class=\" \">Publish by providing </i>Dockerfile section of <a class=\"document-link \" href=\"#!/guide/API_Builder_CLI\">API Builder CLI</a> for more information.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50168708_APIBuilderFAQ-PublishsourcecodeusinganexistingDockerfile\">\n        <h2 class=\"heading \"><span>Publish source code using an existing Dockerfile</span></h2>\n    <p>Refer to the Publish by using existing Docker image section of <a class=\"document-link \" href=\"#!/guide/API_Builder_CLI\">API Builder CLI</a> for more information.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50168708_APIBuilderFAQ-ConfigureaccesstotheAPIBuilderAdminconsole\">\n        <h2 class=\"heading \"><span>Configure access to the API Builder Admin console</span></h2>\n    <p>Refer to the <i class=\" \">Configuration</i> section of <a class=\"document-link \" href=\"#!/guide/API_Builder_Console\">API Builder Console</a> for more information.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50168708_APIBuilderFAQ-CreateamodelusingtheAPIBuilderAdminconsole\">\n        <h2 class=\"heading \"><span>Create a model using the API Builder Admin console</span></h2>\n    <p>Refer to the <i class=\" \">Create a new model</i> section of <a class=\"document-link \" href=\"#!/guide/API_Builder_Getting_Started_Guide\">API Builder Getting Started Guide</a> and the <i class=\" \">API Builder tabs</i> section of <a class=\"document-link \" href=\"#!/guide/API_Builder_Console\">API Builder Console</a> for more information.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50168708_APIBuilderFAQ-AccessAPIBuilderSwaggerdefinitions\">\n        <h2 class=\"heading \"><span>Access API Builder Swagger definitions</span></h2>\n    <p>Refer to the <i class=\" \">API Builder and Swagger</i> section of <a class=\"document-link \" href=\"#!/guide/API_Builder_Console\">API Builder Console</a> for more information.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50168708_APIBuilderFAQ-CreateAPIendpoints\">\n        <h2 class=\"heading \"><span>Create API endpoints</span></h2>\n    <p>Refer to <a class=\"document-link \" href=\"#!/guide/API_Builder_APIs\">API Builder APIs</a> for more information.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50168708_APIBuilderFAQ-ConfigureAPIBuilder\">\n        <h2 class=\"heading \"><span>Configure API Builder</span></h2>\n    <p>Refer to <a class=\"document-link \" href=\"#!/guide/Console_Configuration\">Console Configuration</a> for more information.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50168708_APIBuilderFAQ-CreateAPIBuilderconnectors\">\n        <h2 class=\"heading \"><span>Create API Builder connectors</span></h2>\n    <p>Refer to <a class=\"document-link \" href=\"#!/guide/API_Builder_Connectors\">API Builder Connectors</a> for more information.    </p>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=50168708\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"API Builder FAQ"});